    //     <li className="searchElement">
    //       <input type="text" name="" id="" />
    //     </li>
    //   </ul>
    // </nav>
    <div
      style={{
        display: "flex",
        justifyContent: "space-between",
        backgroundColor: "#333",
        color: "white",
        padding: "5px",
      }}
    >
      <h3>Flight Watch</h3>
      <input
        type="number"
        value={filterFlight}
        onChange={handleFilterInput}
        onKeyDown={handleFilterSubmit}
        placeholder="Search"
        style={{ backgroundColor: "white", padding: "5px", height: "30px" }}
      />
    </div>
  );
};

export default Header;
